import React from "react";
import { useNavigate } from "react-router-dom";



function Header(){
    const navigate=useNavigate();
    return(
        <header>
            <h1>Crypto Exchage Dashboard</h1>
            <button onClick={()=>{
                navigate("/");
            }}>Logout</button>
        </header>
    )
}
export default Header
